import { ADD_BUILDING, REMOVE_BUILDING, UPDATE_BUILDING_TYPE } from '../actions/types'

const initialState = { '1234': { latitude: "38.98626", longitude: "-3.92907", area: "200 m2", type: 'Both' } };

const reducer = (state = initialState, action) => {
    switch (action.type) {
        case UPDATE_BUILDING_TYPE:
            const stateCloned = Object.assign({}, state);
            stateCloned[action.building_id] = action.building_type;
            return stateCloned;
        default:
            return state;
    }

};


export default reducer;
